import React from 'react';
import './css/home.css';

function Navbar() {
  return (
    <div className='study-container'>
      <div className='navbar'>
        <Button>Ambient</Button>
        <Button>Home</Button>
        <Button>Focus</Button>
        <Button>Settings</Button>
      </div>
    </div>
  );
};

export default Navbar;
